import React from 'react';

import './spinner.css';

const Spinner = () => {
    return (
        <div class="lds-css ng-scope"><div style="width:100%;height:100%" class="lds-eclipse"><div></div></div><style type="text/css"></style></div>
    )
}

export default Spinner;
